prediction.sparql:
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?film ?label WHERE {
  {
    ?film fb:film.film.starring ?perf .
    ?perf fb:film.performance.actor fb:m.07ldhs
  } UNION {
    fb:m.07ldhs fb:film.actor.film ?film
  }
  .
  ?film fb:film.film.netflix_id ?netflix_id .
  FILTER ( ?netflix_id > 70099113 ) .
  ?film rdfs:label ?label .
  FILTER ( LANG( ?label ) = 'en' )
}
ORDER BY ?label

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?religionLabel WHERE {
  fb:m.06pq6 rdfs:label ?religionLabel .
  FILTER ( LANG( ?religionLabel ) = "en" )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?language ?languageLabel WHERE {
  fb:m.09c7w0 fb:location.country.languages_spoken ?language .
  OPTIONAL {
    ?language rdfs:label ?languageLabel .
    FILTER ( LANG( ?languageLabel ) = "en" )
  }
}
ORDER BY ?languageLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?film ?label WHERE {
  fb:m.0pz91 fb:film.actor.film ?film .
  ?film fb:film.film.netflix_id ?netflix_id .
  FILTER ( ?netflix_id < 70087541 ) .
  OPTIONAL {
    ?film rdfs:label ?label .
    FILTER ( LANG( ?label ) = "en" )
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?film WHERE {
  fb:m.01hw6wq fb:film.music_contributor.film ?film .
  fb:m.08l257 fb:film.actor.film ?film
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?founder WHERE {
  fb:m.0bwfn fb:organization.organization.founders ?founder .
  ?founder fb:people.deceased_person.place_of_death fb:m.01qcx_
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?year WHERE {
  fb:m.04mjl fb:sports.sports_team.championships ?championship .
  ?championship fb:sports.sports_league_championship_event.year ?year
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?influencer ?label ?deathDate WHERE {
  fb:m.02zjd fb:influence.influence_node.influenced_by ?influencer .
  ?influencer rdfs:label ?label .
  FILTER ( LANG( ?label ) = 'en' ) .
  OPTIONAL {
    ?influencer fb:type.object.type fb:people.person
  }
  .
  OPTIONAL {
    ?influencer fb:type.object.type fb:people.deceased_person
  }
  .
  OPTIONAL {
    ?influencer fb:people.deceased_person.date_of_death ?deathDate
  }
}
ORDER BY ASC ( ?deathDate )
LIMIT 1

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?country ?population ?year WHERE {
  ?country fb:location.country.language fb:m.05zjd .
  ?country fb:location.statistical_region.population ?meas .
  ?meas fb:measurement_unit.dated_integer.number ?population .
  OPTIONAL {
    ?meas fb:measurement_unit.dated_integer.year ?year
  }
}
ORDER BY DESC ( ?year )
LIMIT 10

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?film ?filmLabel WHERE {
  {
    ?film fb:film.film.starring ?perf .
    ?perf fb:film.performance.actor fb:m.0pz91
  } UNION {
    fb:m.0pz91 fb:film.actor.film ?film
  }
  .
  ?film rdfs:label ?filmLabel FILTER ( LANG( ?filmLabel ) = 'en' )
}
ORDER BY ?filmLabel

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?city WHERE {
  OPTIONAL {
    fb:m.05p62cz fb:people.person.place_of_birth ?city
  }
  .
  OPTIONAL {
    ?lala fb:people.person.place_of_birth ?city .
    FILTER ( STRSTARTS( STR( ?lala ) , "fb:m." ) )
  }
}
LIMIT 1

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?film WHERE {
  fb:m.0g2lq fb:film.director.film ?film .
  fb:g.120ndptz fb:film.editor.film ?film
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?currency WHERE {
  fb:m.06ctk fb:language.human_language.countries_spoken_in ?country .
  ?country fb:location.country.currency_used ?currency .
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?brother ?to WHERE {
  VALUES ?brother {
    fb:m.06hx2 fb:m.0194xc
  }
  ?brother fb:government.politician.government_positions_held ?position .
  ?position fb:government.government_position_held.to ?to
}
ORDER BY DESC ( ?to )
LIMIT 1

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?winner ?championship WHERE {
  fb:m.09gnk2r fb:sports.sports_championship_event.champion ?winner .
  ?winner fb:sports.sports_team.championships ?championship
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?film ?filmLabel WHERE {
  ?film fb:film.film.directed_by fb:m.02rjhky .
  {
    ?film fb:film.film.starring ?perf .
    ?perf fb:film.performance.actor fb:m.0dl567
  } UNION {
    fb:m.0dl567 fb:film.actor.film ?film
  }
  .
  ?film rdfs:label ?filmLabel FILTER ( LANG( ?filmLabel ) = 'en' )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?mozartProf ?label ?filmSubject ?filmLabel WHERE {
  fb:m.082db fb:people.person.profession ?mozartProf .
  ?mozartProf rdfs:label ?label
  FILTER ( LANG( ?label ) = "en" ) .
  OPTIONAL {
    fb:m.03qp5b1 fb:film.film.subjects ?filmSubject .
    ?filmSubject rdfs:label ?filmLabel
    FILTER ( LANG( ?filmLabel ) = "en" ) .
    FILTER NOT EXISTS {
      ?filmSubject fb:type.object.type fb:people.person .
      ?filmSubject rdfs:label ?name
      FILTER ( LANG( ?name ) = "en" ) .
      FILTER ( ?name = "Wolfgang Amadeus Mozart" || ?name = "Mozart" )
    }
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?governmentType WHERE {
  fb:m.090krt fb:finance.currency.countries_formerly_used ?country .
  ?country fb:location.country.form_of_government ?governmentType
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?type ?location WHERE {
  {
    fb:m.02pg6z3 fb:location.location.containedby ?loc .
    ?loc rdfs:label ?locale
    FILTER ( LANG( ?locale ) = "en" && STR( ?locale ) = "British Columbia" ) BIND( "Whistler Mountain locale" AS ?type ) BIND( ?locale AS ?location )
  } UNION {
    fb:m.02__34 fb:film.film.featured_film_locations ?loc .
    ?loc rdfs:label ?location
    FILTER ( LANG( ?location ) = "en" && ( STR( ?location ) = "Vancouver" || STR( ?location ) = "Canada" ) ) BIND( "Legends of the Fall filming location" AS ?type )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?country ?label ?isoNumeric WHERE {
  VALUES ?country {
    fb:m.0164b fb:m.01p8s fb:m.02k8k fb:m.0345_ fb:m.03h2c fb:m.05c74 fb:m.05qx1
  }
  ?country fb:location.country.iso_numeric ?isoNumeric .
  ?country rdfs:label ?label
  FILTER ( LANG( ?label ) = 'en' ) FILTER ( ?isoNumeric > 188 )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?label WHERE {
  fb:m.0kw4j rdfs:label ?label .
  FILTER ( LANG( ?label ) = "en" )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?film ?filmLabel WHERE {
  {
    fb:m.057yk8 fb:film.actor.film ?perf .
    ?perf fb:film.performance.film ?film .
  } UNION {
    fb:m.0113yh_y fb:film.actor.film ?perf2 .
    ?perf2 fb:film.performance.film ?film .
  }
  .
  OPTIONAL {
    ?film rdfs:label ?filmLabel .
    FILTER ( LANG( ?filmLabel ) = "en" )
  }
}
ORDER BY ?filmLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?film ?filmLabel ?releaseDate WHERE {
  VALUES ?actor {
    fb:m.0168dy
  }
  {
    ?actor fb:film.actor.film ?film
  } UNION {
    ?film fb:film.film.starring ?perf .
    ?perf fb:film.performance.actor ?actor
  }
  OPTIONAL {
    ?film rdfs:label ?filmLabel FILTER ( LANG( ?filmLabel ) = "en" )
  }
  OPTIONAL {
    ?film fb:film.film.release_date_s ?releaseNode .
    ?releaseNode fb:film.film_regional_release_date.release_date ?releaseDate
  }
}
ORDER BY DESC ( ?releaseDate )
LIMIT 1

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?person ?label WHERE {
  VALUES ?person {
    fb:m.065pzb1 fb:m.065q1bh fb:m.065q516
  }
  ?person rdfs:label ?label FILTER ( LANG( ?label ) = "en" )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?film ?filmLabel WHERE {
  fb:m.05b5yhv fb:film.film_production_designer.films_production_designed ?film .
  {
    ?film fb:film.film.starring ?perf .
    ?perf fb:film.performance.actor fb:m.057yk8
  } UNION {
    fb:m.057yk8 fb:film.actor.film ?film
  }
  OPTIONAL {
    ?film rdfs:label ?filmLabel .
    FILTER ( LANG( ?filmLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?dialect ?label WHERE {
  VALUES ?dialect {
    fb:m.01d1yc fb:m.02hx88 fb:m.02hx37z
  }
  .
  ?dialect rdfs:label ?label FILTER ( LANG( ?label ) = 'en' )
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?brother ?label WHERE {
  fb:m.0d3k14 fb:people.person.sibling_s ?brother .
  ?brother fb:type.object.type fb:people.person .
  ?brother fb:government.politician.government_positions_held ?pos .
  ?pos fb:government.government_position_held.from ?from .
  OPTIONAL {
    ?brother rdfs:label ?label FILTER ( LANG( ?label ) = "en" )
  }
  FILTER ( ( datatype( ?from ) = xsd:gYear && STR( ?from ) < "1962" ) || ( datatype( ?from ) = xsd:date && ?from < "1962-11-06" ^^ xsd:date ) )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?program ?tvrage_id WHERE {
  VALUES ?program {
    fb:m.03l3nqm fb:m.03l92l8 fb:m.04dbszl fb:m.05n5lp_ fb:m.06649b7 fb:m.0bmnfls fb:m.0ks_94_ fb:m.0wjvv1s fb:m.0zv9jd_
  }
  ?program fb:type.object.key ?key .
  FILTER ( STRSTARTS( ?key , '/authority/tvrage/series_numeric/' ) ) .
  BIND( REPLACE( ?key , '/authority/tvrage/series_numeric/' , '' ) AS ?tvrage_id )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?filmLabel WHERE {
  fb:m.0gttw8n rdfs:label ?filmLabel FILTER ( LANG( ?filmLabel ) = "en" )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?work ?workLabel WHERE {
  {
    fb:m.08l257 fb:film.actor.film ?work
  } UNION {
    ?perf fb:film.performance.actor fb:m.08l257 .
    ?perf fb:film.performance.film ?work
  }
  OPTIONAL {
    ?work rdfs:label ?workLabel FILTER ( LANG( ?workLabel ) = 'en' )
  }
  FILTER ( ?work = fb:m.0dnh5w )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?systemLabel ?senateLabel WHERE {
  fb:m.06frc fb:government.governmental_jurisdiction.government_bodies fb:m.011ynm .
  OPTIONAL {
    fb:m.06frc rdfs:label ?systemLabel FILTER ( LANG( ?systemLabel ) = "en" )
  }
  OPTIONAL {
    fb:m.011ynm rdfs:label ?senateLabel FILTER ( LANG( ?senateLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?text ?label WHERE {
  fb:m.01tbmq fb:religion.deity.deity_of ?religion .
  ?religion fb:religion.religion.texts ?text .
  OPTIONAL {
    ?text rdfs:label ?label FILTER ( LANG( ?label ) = "en" )
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?text WHERE {
  fb:m.0164zy fb:religion.founding_figure.religion_founded ?religion .
  ?religion fb:religion.religion.texts ?text .
  FILTER ( ?text != fb:m.0164zy )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?championship WHERE {
  fb:m.07l24 fb:sports.sports_team.championships ?championship
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?country ?countryLabel WHERE {
  fb:m.01zps5 fb:government.politician.government_positions_held ?position .
  ?position fb:government.government_position_held.jurisdiction_of_office ?country .
  ?country fb:location.country.official_language fb:m.05zjd .
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?person ?personLabel ?profession ?professionLabel WHERE {
  fb:m.053myr fb:location.location.people_born_here ?person .
  ?person rdfs:label ?personLabel
  FILTER ( LANG( ?personLabel ) = 'en' ) .
  OPTIONAL {
    ?person fb:people.person.profession ?profession .
    ?profession rdfs:label ?professionLabel
    FILTER ( LANG( ?professionLabel ) = 'en' )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?film ?filmLabel WHERE {
  ?film fb:film.film.starring ?performance .
  ?performance fb:film.performance.actor fb:m.08l257 .
  ?film fb:film.film.film_casting_director fb:m.08mt595 .
  OPTIONAL {
    ?film rdfs:label ?filmLabel .
    FILTER ( LANG( ?filmLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?film ?filmLabel WHERE {
  {
    fb:m.057yk8 fb:film.actor.film ?film .
  } UNION {
    ?film fb:film.film.starring ?perf .
    ?perf fb:film.performance.actor fb:m.057yk8 .
  }
  ?film rdfs:label ?filmLabel FILTER ( LANG( ?filmLabel ) = 'en' )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?child ?childLabel ?deathDate WHERE {
  VALUES ?child {
    fb:m.064ndq fb:m.07kyh5
  }
  .
  ?child rdfs:label ?childLabel FILTER ( LANG( ?childLabel ) = 'en' ) .
  ?child fb:people.deceased_person.date_of_death ?deathDate
}
